function Register() {

   const Logo = styled.div`
   width : 100%;
   height : auto;
   text-align : center;
   padding-top : 20px
   `

   const Alldiv = styled.div`
   width : 30%;
   height : 400px;
   margin : auto;
   border : solid 1px white;
   @media (max-width: 768px) {
    width : 100%;
   height : 600px;
   border : solid 1px white;
  }
   `

  return (
    <div>
    <Logo>
    <FaWhatsapp style = {{fontSize : "80px",color : "white"}}/>
    </Logo>

    <Alldiv></Alldiv>







    </div>
  )
}

export default Register
